import axios from 'axios'

const Search = axios.create({
    baseURL: 'https://api.themoviedb.org/3'
})

const Movie_API_Info = axios.create({
    baseURL: 'https://api.themoviedb.org/3/movie'
})

export const Movie_API =  {
    Movie_API_Search,
    Movie_API_Info
};
